// Contact.js - Team Members Profile & Contributions

import React from "react";
import { Container, Typography, Grid, Card, CardContent, Avatar } from "@mui/material";
import "./Contact.css";

const teamMembers = [
  {
    name: "Alice Johnson",
    role: "Project Manager",
    contributions: "Oversaw project development and coordinated tasks.",
    avatar: "https://via.placeholder.com/100",
  },
  {
    name: "Bob Smith",
    role: "Lead Developer",
    contributions: "Developed core functionalities and backend API.",
    avatar: "https://via.placeholder.com/100",
  },
  {
    name: "Charlie Brown",
    role: "UI/UX Designer",
    contributions: "Designed user interfaces and improved user experience.",
    avatar: "https://via.placeholder.com/100",
  },
  {
    name: "Diana Green",
    role: "QA Engineer",
    contributions: "Tested and debugged application features.",
    avatar: "https://via.placeholder.com/100",
  },
];

const Contact = () => {
  return (
    <Container maxWidth="md" className="contact-container">
      <Typography variant="h3" className="contact-title">
        Meet Our Team
      </Typography>
      <Grid container spacing={3}>
        {teamMembers.map((member, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Card className="team-card" elevation={6}>
              <CardContent>
                <Avatar src={member.avatar} alt={member.name} className="team-avatar" />
                <Typography variant="h5" className="team-name">{member.name}</Typography>
                <Typography variant="subtitle1" className="team-role">{member.role}</Typography>
                <Typography className="team-contributions">{member.contributions}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Contact;
